INSERT INTO "PUBLIC"."PUBLIC"."APP_PAGE_INFO" (PAGE_ID,SYS_EMBD_YN,SYS_INST_DATE,SYS_INST_USER_ID,SYS_UPDT_DATE,SYS_UPDT_USER_ID,PAGE_CNTS,PAGE_DESC,EDIT_PLCY,PAGE_FMAT,PAGE_NAME,READ_PLCY) VALUES ('BADC19CC1E9947E99A67DD1B71DD14FF','N',{ts '2020-05-17 22:31:25'},'admin',{ts '2020-05-18 02:07:07'},'admin','<p><img alt="" src="https://www.google.com/images/branding/googlelogo/2x/googlelogo_color_92x30dp.png" style="height:60px; width:184px" /></p>\n\n<p>In templatename :: selector, both templatename and selector can be fully-featured expressions. In the below example we want to include different fragments depending on a condition. If the authenticated user is an Admin, we will show a different footer than for a regular user:</p>\n\n<p><strong>&copy; 2016 The Static Templates</strong></p>\n\n<p>fragments/footer.html has slightly changed, as we need to have two footers defined:</p>\n\n<p>...<br />\n&copy; 2016 Footer</p>\n\n<p>&copy; 2016 Admin Footer</p>\n\n<table border="1" cellpadding="1" cellspacing="1" style="width:500px">\n	<tbody>\n		<tr>\n			<td></td>\n			<td></td>\n		</tr>\n		<tr>\n			<td>1</td>\n			<td>spring framework</td>\n		</tr>\n		<tr>\n			<td>2</td>\n			<td></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Parameterized inclusion Fragments can specify arguments, just like methods. Whenever they are explicitly specified with a th:fragment attribute, they can provide an argument signature that can then be filled in with arguments from the calling th:insert or th:replace attributes. Examples talk best. We can use parameterized inclusion in many contexts but one real life context is displaying messages on different pages of our application after successful form submission. Let&rsquo;s look at the signup process in the application: @PostMapping(&quot;signup&quot;) String signup(@Valid @ModelAttribute SignupForm signupForm, Errors errors, RedirectAttributes ra) { if (errors.hasErrors()) { return SIGNUP_VIEW_NAME; } Account account = accountRepository.save(signupForm.createAccount()); userService.signin(account); // see /WEB-INF/i18n/messages.properties and /WEB-INF/views/homeSignedIn.html MessageHelper.addSuccessAttribute(ra, &quot;signup.success&quot;); return &quot;redirect:/&quot;; } As you can see, after a successful signup the user will be redirected to the home page with a flash attribute filled in. We want to create a reusable and parameterized fragment. This can be done as follows:...</p>\n\n<p>&times;Test</p>\n\n<p>The above alert fragment takes two arguments: type and message. The type is the message type used for styling a message whereas the message is a text that will be shown to the user. We ensure that arguments exist and are not empty by using a th:assert attribute. In order to include alert in any template we may write the following code (please note, that the value of a variable can be an expression):</p>\n\n<p>...</p>\n\n<p><strong>Parameterized fragments let developers create functional-like fragments that are easier to reuse. Read more about parameterized fragments in the Thymeleaf documentation: Parameterizable fragment signatures.</strong></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n','22222','AUTHORIZED','HTML','Solution Library','ANONYMOUS');
